import { AUTH, LOGOUT } from '../constants/actions.js';

const WorkspaceReducers = (workspaces = [], action) => {
	switch (action.type) {
    case AUTH:
		return action.payload;
    default:
		return workspaces;
	}
};

export default WorkspaceReducers
